/* **************************************** */
/*          INSTRUCCIONES INICIALES         */
/* **************************************** */
SET CLIENT_ENCODING TO 'UTF8';

/* **************************************** */
/*                 ESQUEMA                  */
/* **************************************** */

-- usuario
create table public.usuario (
  id bigserial primary key not null,
  nombre character varying(100) not null,
  apellido character varying(100) not null,
  usuario character varying(100) not null,
  correo character varying(254) not null,
  contrasena character varying(100) not null,
  telefono character varying(15) not null,
  fecha_nacimiento date not null,
  foto_perfil character varying(100) not null
);
create unique index usuario_usuario_key on usuario using btree (usuario);
create index usuario_usuario_like on usuario using btree (usuario);

-- publicacion
create table public.publicacion (
  id bigserial primary key not null,
  titulo character varying(100) not null,
  fecha timestamp with time zone not null,
  publicacion character varying(100) not null,
  usuario_id bigint not null,
  foreign key (usuario_id) references public.usuario (id)
  match simple on update restrict on delete cascade
);
create index publicacion_usuario_id on publicacion using btree (usuario_id);

-- seguimiento
create table public.seguimiento (
  id bigserial primary key not null,
  seguido_id bigint not null,
  seguidor_id bigint not null,
  foreign key (seguido_id) references public.usuario (id)
  match simple on update restrict on delete cascade,
  foreign key (seguidor_id) references public.usuario (id)
  match simple on update restrict on delete cascade
);
create unique index seguimiento_seguidor_id_seguido_id_uniq on seguimiento using btree (seguidor_id, seguido_id);
create index seguimiento_seguido_id on seguimiento using btree (seguido_id);
create index seguimiento_seguidor_id on seguimiento using btree (seguidor_id);

-- comentario
create table public.comentario (
  id bigserial primary key not null,
  comentario character varying(300) not null,
  fecha timestamp with time zone not null,
  publicacion_id bigint not null,
  usuario_id bigint not null,
  foreign key (publicacion_id) references public.publicacion (id)
  match simple on update restrict on delete cascade,
  foreign key (usuario_id) references public.usuario (id)
  match simple on update restrict on delete cascade
);
create index comentario_publicacion_id on comentario using btree (publicacion_id);
create index comentario_usuario_id on comentario using btree (usuario_id);

-- like
create table public."like" (
  id bigserial primary key not null,
  fecha timestamp with time zone not null,
  publicacion_id bigint not null,
  usuario_id bigint not null,
  foreign key (publicacion_id) references public.publicacion (id)
  match simple on update restrict on delete cascade,
  foreign key (usuario_id) references public.usuario (id)
  match simple on update restrict on delete cascade
);
create unique index like_publicacion_id_usuario_id_uniq on "like" using btree (publicacion_id, usuario_id);
create index like_publicacion_id on "like" using btree (publicacion_id);
create index like_usuario_id on "like" using btree (usuario_id);


